(1, 'Grille Walnut Buffet Cabinet with Storage, Sideboards 2 Doors with Metal Base and Adjustable Shelf for Kitchen, Coffee Bar, Dining Room, Entryway, Hallway,Living Room', 7676.00, 'Multi-purpose matching - with a unique elastic door design and no handles, this wooden cabinet can be easily integrated into various spaces, whether it is used as a sideboard in the restaurant, a TV table in the living room, or storage in the office. You can also buy multiple storage cabinets and freely combine them together to store and organize trivial items, and meet your storage needs in various possible ways.\r\nSturdy and Stable--The walnut color decorative cabinet is made of high-quality engineered wood as a whole, which is waterproof, scratch-resistant and wear-resistant, with a safe and strong weight capacity. The metal legs are sturdy and stable, with a long-lasting structure and easy to clean. There is an anti-dumping device on the back of the sideboard to ensure the safety of children or pets.', 'rack.jpg', );
